    // Blank rows shouldn't be included - they're easy to detect and skip.
    if (data[i].lon === null || data[i].lat === null) continue;
    titik.push([data[i].lon, data[i].lat, data[i].name, data[i].alti, data[i].channel]);

  }

  for (var i = 0; i < titik.length; i++) {
        var a = titik[i];
        var marker = L.marker(new L.LatLng(a[1], a[0]));
        marker.bindPopup('<div class="point-data"><figure><div><img src="http://duniasipil31.files.wordpress.com/2011/07/bangunan-irigasi.jpg"></div></figure><div class="meta"><div class="name">' + a[2] +'</div><div class="di"><span>D.I.</span> : ' + a[4] + '</div><div class="lat"><span>Lat</span> :' + a[1] +'</div><div class="long"><span>Long</span> : '+ a[0] +'</div><div class="alti"><span>Alti</span> : ' + a[3] +'mdpl</div></div></div>');
        markers.addLayer(marker);
    }


    map.addLayer(markers);    
    map.fitBounds(markers.getBounds());



}
